import "../../../style.css";
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";
import vector3 from "../../../images/Vector 3.png";
import vector4 from "../../../images/Vector 4.png";
import logo from "../../../images/logo.PNG";
import homepageIcon from "../../../images/homepage_icon.png";
import customerIcon from "../../../images/customer_icon.png";
import managerIcon from "../../../images/manager_icon.png";

import { Link } from "react-router-dom";
import { useUserContext } from "../../../contexts/AuthContext";

function PrivateHomeManager() {
  const { selectRole } = useUserContext();
  return (
    <div>
      <Row>
        <Col
          className="d-flex justify-content-center  col-m-200
        "
          sm={12}
        >
          <h1 className="text-center">Hotel Details </h1>
        </Col>
        <Link
          to="/signup"
          style={{ textDecoration: "none", color: "inherit" }}
          onClick={() => selectRole(1)}
        >
          <Col
            className="d-flex border border-gray mx-auto   customButton4  col-button"
            sm={12}
          >
            <div className="mr-4 border">
              <img src={customerIcon} alt="logo" />
            </div>
            <div className="text-left border">
              <h1>All Staff</h1>
            </div>
          </Col>
        </Link>
        <Link
          to="/signup"
          style={{ textDecoration: "none", color: "inherit" }}
          onClick={() => selectRole(2)}
        >
          <Col
            className="d-flex justify-content-center  border border-gray mx-auto align-items-center customButton4 col-button"
            sm={12}
          >
            <div className="mr-4">
              <img src={managerIcon} alt="logo" />
            </div>
            <div className="text-left">
              <h1>Add Staff</h1>
            </div>
          </Col>
        </Link>
      </Row>
    </div>
  );
}

export default PrivateHomeManager;
